data.text:
Le ministre 
@olivierveran
 reproche avec rage et mépris à l’assemblée nationale d’avoir adopté un amendement dont sa majorité ne voulait pas. Il oublie que c’est lui qui doit rendre des comptes aux représentants du peuple et non l’inverse. #DirectAN

@bitcoinpanda69 Isn't it convenient that we have a target to point "our" collective rage against?
I am anti-fascism. I can't be ANTIFA b/c "they" reframed the narrative. 
"Far-right, authoritarian ultranationalism: dictatorial power, forcible suppression of opposition &amp; regimentation of society"
